import React from "react";
import styles from "./MainImage.module.css"

const MainImage = () => {
  return (
    <section>
      <div className={styles.main_image}>
        <h1 className={styles.title}>子ども✖︎先生のマッチングサービス</h1>
      </div>
      <h2 className={styles.title}>自分にあった先生を見つける</h2>
    </section>
  )
}

export default MainImage
